script_name = "FixItAll"
script_description = "FixItAll! FixItAll! I dont give a shit anymooooore! FixItAll! FixItAll... the errors never bothered me anyway."
script_author = "Leinad4Mind"
script_version = "1.0"

include("karaskel.lua")
include("cleantags.lua")
re = require 'aegisub.re'

--Cleantags do cleantags-autoload
function cleantags_subs(subtitles)
	local linescleaned = 0
	for i = 1, #subtitles do
		aegisub.progress.set(i * 100 / #subtitles)
		if subtitles[i].class == "dialogue" and not subtitles[i].comment then
			ntext = cleantags(subtitles[i].text)
			local nline = subtitles[i]
			nline.text = ntext
			subtitles[i] = nline
			linescleaned = linescleaned + 1
			aegisub.progress.task(linescleaned .. " linhas corrigidas")
		end
	end
	aegisub.log("Se o ficheiro for grande terão de esperar, labregos! Quando o botão disser \"Fechar\" aí cliquem.")
end

--Recolhe nomes dos estilos
function collect_styles(subs)
	local n, styles = 0, {}
	for i=1, #subs do
		local sub = subs[i]
		if sub.class == "style" then
			n = n + 1
			styles[n] = sub.name
		end
	end
	return styles
end

--Configuração
function create_confi(subs)
	local styles = collect_styles(subs)
	local conf = {
		{
			class = "label",
			x = 1, y = 0, width = 5, height = 1,
			label = "\n...| Desenvolvido por Leinad4Mind |...",
		},
		{
			class = "label",
			x = 1, y = 2, width = 1, height = 1,
			label = "Seleccione:"
		},
		{
			class = "dropdown", name = "comment",
			x = 2, y = 2, width = 5, height = 1,
			items = {"Legenda Portuguesa", "Legenda Brasileira"}, value = "Legenda Portuguesa", hint = "Deseja corrigir legendas?"
		},
		{
			class = "label",
			x = 1, y = 3, width = 1, height = 1,
			label = "Seleccione:"
		},
		{
			class = "dropdown", name = "chosen",
			x = 2, y = 3, width = 5, height = 1,
			items = {"Todas as Linhas", "Linhas Seleccionadas"}, value = "Todas as Linhas", hint = "Linhas Seleccionadas ou Estilo Específico?"
		}
	}
	for i,w in pairs(styles) do
		table.insert(conf[5].items,"Estilo: " .. w)
	end
	return conf
end

function corrigir(subs,i,config)
	local line = subs[i]
		if line.class == "dialogue" then
			if config.comment == "Legenda Brasileira" then
				--corrigir brasileirismos
				--A
				line.text = re.sub(line.text, "\\b([Aa])ção\\b","$1cção")
				line.text = re.sub(line.text, "\\b([Aa])cessar","$1aceder")
				line.text = re.sub(line.text, "\\b([Aa])fet([aiou])","$1fect$2")
				line.text = re.sub(line.text, "\\b([Aa])tiv([aio])","$1tiv$2")
				--B
				line.text = re.sub(line.text, "\\bbunda\\b","rabo")
				line.text = re.sub(line.text, "\\bBunda\\b","Rabo")
				line.text = re.sub(line.text, "\\bbagunça\\b","confusão")
				line.text = re.sub(line.text, "\\bbesteira\\b","disparates")
				line.text = re.sub(line.text, "\\bem uma(s?)","numa$1")
				line.text = re.sub(line.text, "\\bboy","rapaz")
				--C
				line.text = re.sub(line.text, "\\b([cC])âncer\\b","$1ancro")
				line.text = re.sub(line.text, "\\bcara(s?)\\b","gajo$1")
				line.text = re.sub(line.text, "\\bCara(s?)\\b","Gajo$1")
				line.text = re.sub(line.text, "\\b([cC])erimônia(s?)\\b","$1erimónia$2")
				line.text = re.sub(line.text, "\\bcelular\\b","telemóvel")
				line.text = re.sub(line.text, "\\bCelular\\b","Telemóvel")
				line.text = re.sub(line.text, "\\b([Cc])oletiv([aio])","$1olectiv$2")
				line.text = re.sub(line.text, "\\b([Cc])ontat\\B","$1ontact")
				line.text = re.sub(line.text, "\\b([Cc])âmera","$1âmara")
				line.text = re.sub(line.text, "\\b([Cc])omitê","$1omité")
				line.text = re.sub(line.text, "\\b([Cc])ontêiner","$1ontentor")
				line.text = re.sub(line.text, "\\b([Cc])onosco\\b","$1onnosco")
				line.text = re.sub(line.text, "\\b([Cc])orreção\\b","$1orrecção")
				line.text = re.sub(line.text, "\\b([Cc])om vocês\\b","$1onvosco")
				--D
				line.text = re.sub(line.text, "\\b([Dd])e vocês\\b","$1e vós")
				line.text = re.sub(line.text, "\\b([Dd])e você\\b","$1e ti")
				line.text = re.sub(line.text, "\\b([Dd])o jeito","$1o modo")
				line.text = re.sub(line.text, "\\b([Dd])ecolagem","$1escolagem")
				line.text = re.sub(line.text, "\\b([Dd])etetive","$1etective")
				line.text = re.sub(line.text, "\\b([Dd])iretor","$1irector")
				line.text = re.sub(line.text, "\\b([Dd])ireção","$1irecção")
				line.text = re.sub(line.text, "\\b([Dd])iret\\B","$1irect")
				--E
				line.text = re.sub(line.text, "\\b(espera)ndo\\b","à $1")
				line.text = re.sub(line.text, "\\b(Espera)ndo\\b","À $1")
				line.text = re.sub(line.text, "\\b([Ee])quipe","$1quipa")
				line.text = re.sub(line.text, "\\b([Ee])mbaixo","$1m baixo")
				line.text = re.sub(line.text, "\\b([Ee])xat([aio])","$1xact$2")
				line.text = re.sub(line.text, "\\b([Ee])xcet([iou])","$1xcept$2")
				line.text = re.sub(line.text, "\\b([Ee])fetiv\\B","$1fectiv")
				--F
				line.text = re.sub(line.text, "\\bferrado","tramado")
				line.text = re.sub(line.text, "\\bFerrado","Tramado")
				line.text = re.sub(line.text, "\\bfreios","travões")
				line.text = re.sub(line.text, "\\bFreios","Travões")
				--G
				line.text = re.sub(line.text, "\\bgarot([oa])","miúd$1")
				line.text = re.sub(line.text, "\\bGarot([oa])","Miúd$1")
				line.text = re.sub(line.text, "\\b([gG])ênio","$1énio")
				line.text = re.sub(line.text, "\\bgrana\\b","dinheiro")
				line.text = re.sub(line.text, "\\bGrana\\b","Dinheiro")
				--H
				line.text = re.sub(line.text, "\\b(,?\\s?)(hein|hã)\\b","")
				--I
				line.text = re.sub(line.text, "\\b([Ii])déia","$1deia")
				line.text = re.sub(line.text, "\\b([Ii])njetado","$1njectado")
				--J
				--K
				--L
				--M
				line.text = re.sub(line.text, "\\b([Mm])achucar","%1agoar")
				line.text = re.sub(line.text, "\\bmachucando","a magoar")
				line.text = re.sub(line.text, "\\bMachucando","A magoar")
				line.text = re.sub(line.text, "\\bme pegou","apanhou-me")
				line.text = re.sub(line.text, "\\bMe pegou","Apanhou-me")
				line.text = re.sub(line.text, "\\b([Mm])onitorando","$1onitorizando")
				--N
				--O
				line.text = re.sub(line.text, "\\b([oO])i\\B","$1lá")
				line.text = re.sub(line.text, "\\b([ÔO])nibus\\b","Autocarro")
				line.text = re.sub(line.text, "\\b([ôo])nibus\\b","autocarro")
				line.text = re.sub(line.text, "\\b([Óó])tim\\B","$1ptim")
				line.text = re.sub(line.text, "\\b([Oo])xigêni([ia])","$1xigéni$2")
				--P
				line.text = re.sub(line.text, "\\b([Pp])olicial","$1olícia")
				line.text = re.sub(line.text, "\\b([Pp])oliciais","$1olícias")
				line.text = re.sub(line.text, "\\b([pP])or que","$1orque")
				line.text = re.sub(line.text, "\\b([pP])rojet\\B","$1roject")
				line.text = re.sub(line.text, "\\b([pP])rotet\\B","$1rotect")
				line.text = re.sub(line.text, "\\b(procura)ndo\\b","à $1")
				line.text = re.sub(line.text, "\\b(Procura)ndo\\b","À $1")
				--Q
				line.text = re.sub(line.text, "\\bquebrado","partido")
				--R
				line.text = re.sub(line.text, "\\brastreado","perseguido")
				line.text = re.sub(line.text, "\\b([Rr])eação","$1eacção")
				line.text = re.sub(line.text, "\\b([Rr])egistro","$1egisto")
				line.text = re.sub(line.text, "\\b([Rr])et\\B","$1ect")
				line.text = re.sub(line.text, "\\bruim\\b","mau")
				line.text = re.sub(line.text, "\\bRuim\\b","Mau")
				--S
				--line.text = re.sub(line.text, "\\bsua(s?)","a$1 tua$1")
				--line.text = re.sub(line.text, "\\bSua(s?)","A$1 tua$1")
				line.text = re.sub(line.text, "([Ss])eqüestrador","$1equestrador")
				line.text = re.sub(line.text, "([Ss])elecionado","$1eleccionado")
				--T
				line.text = re.sub(line.text, "\\b([Tt])odo mundo","$1oda gente")
				--U
				--V
				line.text = re.sub(line.text, "\\bvan\\b","carrinha")
				line.text = re.sub(line.text, "\\bVan\\b","Carrinha")
				line.text = re.sub(line.text, "\\bvocê está\\b","estás")
				line.text = re.sub(line.text, "\\bVocê está\\b","Estás")
				line.text = re.sub(line.text, "\\bvocê é\\b","és")
				line.text = re.sub(line.text, "\\bVocê é\\b","És")
				line.text = re.sub(line.text, "\\bvocê foi\\b","foste")
				line.text = re.sub(line.text, "\\bVocê foi\\b","Foste")
				line.text = re.sub(line.text, "\\bvocê (\\w+ria)","$1s")
				line.text = re.sub(line.text, "\\bVocê (\\w+ria)","\\u$1s")
				line.text = re.sub(line.text, "\\bVocê (\\l)(\\w+)","\\u$1$2s")
				--Y
				line.text = re.sub(line.text, "\\b(yeah|ya)\\b","sim")
				line.text = re.sub(line.text, "\\b(Yeah|Ya)\\b","Sim")
				-- Globais
				line.text = re.sub(line.text, "([\\s,.?!])e([ao])([\\s,.?!])","$1e $2$3")
				line.text = re.sub(line.text, "\\b([^-])(se|te|me|lhe)\\s(\\w\\w\\w+)\\b","$1$3-$2")
				line.text = re.sub(line.text, "\\b(não\\s)(\\w\\w\\w+)-(te|me|lhe)\\b","$1$3 $2")
				line.text = re.sub(line.text, "\\b(\\w\\w+)indo\\b","a $1ir")
				line.text = re.sub(line.text, "\\b(\\w\\w\\w+)ando\\b","a $1ar")
				line.text = re.sub(line.text, "\\b(\\w+)endo\\b","a $1er")
			end

				--remover >> do texto - FUNCIONA
				line.text = line.text:gsub(">>","")

				--corrigir itálico srt - FUNCIONA
				line.text = line.text:gsub("%s?</? ?[iI]>","{\\i0}")
				
				-- corrigir se "frase] frase" -> "[frase] frase" - FUNCIONA
				line.text = re.sub(line.text, "([\\w ]+)]","[$1]")
				line.text = re.sub(line.text, "\\[\\[","[")

				-- '' por " - FUNCIONA
				line.text = line.text:gsub("''","\"")

				-- Reticências com .. ficar ... - FUNCIONA
				line.text = line.text:gsub("(%.%.)([^ .\\]?)","%1.%2")
				line.text = line.text:gsub("(%.%.)([%.]+)","%1.")

				-- Espaços após pontuação . ! ? e {} - FUNCIONA
				line.text = line.text:gsub("([%.%?!,:;])([^ ^%d^\\^{])","%1 %2")
				line.text = line.text:gsub("(%.)%s(%.)","%1%2") --corrigir . . .
				line.text = line.text:gsub("(%.)%s(\")","%1%2") --corrigir ."$
				-- Espaços após reticências - FUNCIONA
				line.text = line.text:gsub("(%.%.%.)([^%s^\\{^\\^\"])","%1 %2")
				line.text = line.text:gsub("^({\\%w+}) +(.*) +({\\%w+})$","%1%2%3")
				line.text = re.sub(line.text, "(-|–|—)([^\\s–—-]\\L)","$1 $2")
				line.text = re.sub(line.text, "^(\\s+)(-|–|—)","$2")

				-- Apaga Duplo Espaço! - FUNCIONA
				line.text = line.text:gsub("([%s])([%s]+)","%1")

				-- Espaço antes da , e ; e {} - FUNCIONA
				line.text = line.text:gsub("( +)(,)","%2")
				line.text = line.text:gsub("( +)(;)","%2")
				line.text = line.text:gsub("( +)({)"," %2")
				line.text = line.text:gsub("(})( +)","%1 ")

				--Tratar de letras juntas as tags frase{\tag}frase{\tag}frase -> frase {\tag}frase{\tag} frase
				line.text = line.text:gsub("}(%l)","} %1") -- aplica espaço após todos }
				line.text = re.sub(line.text, "(\\l|-|–|—)\\s?(\\{\\\\\\w+\\})\\s(\\l+)(\\{\\\\\\w+\\})?","$1 $2$3$4") --correcção de f {\tag} f -> f {\tag}f em toda a frase
				line.text = re.sub(line.text, "(\\l)\\s(\\{\\\\\\w+\\})([\\l\\?!.,:;]+)$","$1$2 $3") --correcção de {\tag}f -> {\tag} f fim da frase
				line.text = re.sub(line.text, "^(\\{\\\\\\w+\\})\\s(\\l)","$1$2") --correcção de {\tag} f -> {\tag}f inicio de frase

				-- Espaço antes da ! e ? - FUNCIONA
				line.text = line.text:gsub("( +)(%?)","%2")
				line.text = line.text:gsub("( +)(%!)","%2")
				line.text = line.text:gsub("([^%-%–%—%w]%s+)(%.)","%2")
				line.text = line.text:gsub("([^%-%–%—]: )( +)(%.)","$1%3")
				--Espaço antes de hifen etc - FUNCIONA
				line.text = line.text:gsub("(\\N +)([%-%–%—])","\\N%2")
				line.text = line.text:gsub("( +\\N)([%-%–%—])","\\N%2")

				-- Espaço no meio de digitos passa a . - FUNCIONA
				line.text = re.sub(line.text, "(\\d+) +(\\d+)( +(\\d+))*","$1$2$4")
				line.text = re.sub(line.text, "(\\d+)(\\d{3})+","$1.$2")
				line.text = re.sub(line.text, "(\\d+)(\\d{3}.\\d{3})+","$1.$2")

				--corrigir "C0itada", ou seja, passar o número 0 no meio de palavras a o - FUNCIONA
				line.text = re.sub(line.text, "(\\l+)0([^\\}^\\d])","$1o$2")
				line.text = re.sub(line.text, "(\\l*)0(\\l+)","$1o$2")
				line.text = re.sub(line.text, "(\\u+)0([^\\}^\\d])","$1O$2")
				line.text = re.sub(line.text, "(\\u*)0(\\u+)","$1O$2")

				--remover ponto final dps de ? ou ! ou , - FUNCIONA
				line.text = re.sub(line.text, "([?!,])[,\\.]","$1")

				--Corrigir múltiplus ??->? e !!->! e ?????->? e !!!!!!->!!!
				line.text = re.sub(line.text, "(!{3}!+)","!!!")
				line.text = re.sub(line.text, "([^!])(!!)$","$1!")
				line.text = re.sub(line.text, "(([?,:;]){2,})","$2")


				-- Hífens para meia-risca removendo espaços - FUNCIONA
				line.text = line.text:gsub("^- ([^ ])","– %1")
				line.text = line.text:gsub("^-([^ ])","– %1")
				line.text = line.text:gsub("(\\[Nn])- ?([^ ])","%1– %2")
				line.text = line.text:gsub("^({.-}+)-([^ ])","%1– %2")
				-- manter meia-risca removendo espaços - FUNCIONA
				line.text = line.text:gsub("^({.-}*)–([^ ])","%1– %2")
				line.text = line.text:gsub("(\\[Nn])–([^ ])","%1– %2")
				--line.text = line.text:gsub("^({.-}+)–([^ ])","%1– %2")
				-- manter travessão removendo espaços - FUNCIONA
				line.text = line.text:gsub("^({.-}*)—([^ ])","%1— %2")
				line.text = line.text:gsub("(\\[Nn])—([^ ])","%1— %2")
				--line.text = line.text:gsub("^({.-}+)—([^ ])","%1— %2")
				--uniformizar hífen, meia-risca e travessão
				line.text = re.sub(line.text, "([-–—]\\s)(.*\\\\N)([-–—]\\s)","$1$2$1")

				--corrigir diálogos: "Olá João! - Olá Maria" -> "- Olá João!\N- Olá Maria" - FUNCIONA
				--se frase começa com hífen, meia-risca ou Travessão = - frase - frase -> - frase\N- frase
				line.text = re.sub(line.text, "([-–—]\\s)(.*)(\\s)([-–—]\\s)(.*)$","$1$2\\\\N$1$5")
				--se frase começa com hífen, meia-risca ou Travessão = frase\N- frase -> - frase\N- frase
				line.text = re.sub(line.text, "^(\\{\\\\\\w+\\})([^–—'\"]*\\\\N\\s?)([–—]\\s?)(.*)$","$1$3$2$3$4")
				line.text = re.sub(line.text, "^([^–—'\"]*\\\\N\\s?)([–—]\\s?)(.*)$","$2$1$2$3")
				--se frase começa com hífen, meia-risca ou Travessão = - frase -> frase
				if not line.text:match("\\[Nn]") then
					line.text = re.sub(line.text, "^[-–—]\\s?([^-–—]*)$","$1")
					line.text = line.text:gsub("^({.-})%-%s?([^%-]*)$","%1%2")
					line.text = line.text:gsub("^({.-})%–%s?([^%–]*)$","%1%2")
					line.text = line.text:gsub("^({.-})%—%s?([^%—]*)$","%1%2")
				else
				--se frase começa com hífen, meia-risca ou Travessão = - frase\N frase -> - frase\N- frase
					line.text = line.text:gsub("^(–%s?)(.*\\[Nn])([^–])(.*)","%1%2%1%3%4")
					line.text = line.text:gsub("^(—%s?)(.*\\[Nn])([^—])(.*)","%1%2%1%3%4")
					line.text = line.text:gsub("^({.-})(– ?)(.*\\[Nn])([^–])","%1%2%3%2%4")
					line.text = line.text:gsub("^({.-})(— ?)(.*\\[Nn])([^—])","%1%2%3%2%4")
					-- Apaga Duplo Espaço! - FUNCIONA
					line.text = line.text:gsub("([%s])([%s]+)","%1")
				end

				--FAZER passar \Nn- %l para maiuscula  e 
				
				--corrigir "--" ou "—" depois de uma palavra para "..." - FUNCIONA
				line.text = re.sub(line.text, "(\\w:)(—|--)","$1...")

