				line.text = re.sub(line.text, "\\b([vV])uner[aá]ve(l?)","$1ulneráve$2") --vulnerável e vulneráveis
				--X
				line.text = re.sub(line.text, "\\b([xX])adrês", "$1adrez") -- xadrês -> xadrez
				line.text = re.sub(line.text, "\\bx[ie]lindró(s?)", "chilindró$1") -- xilindró / xelindró / xelindró -> chilindró
				line.text = re.sub(line.text, "\\bX[ie]lindró(s?)", "Chilindró$1") -- Xilindró / Xelindró / Xelindró -> Chilindró

				-- Correcção de tava e tou para 'tava e 'tou - FUNCIONA
				if not line.text:match("('[tT]ava)") or not line.text:match("('[tT]ou)") then
					line.text = re.sub(line.text, "\\b([tT])(ava|ou)\\b", "'$1$2") -- tava -> 'tava
				end

				--concerteza para com certeza - FUNCIONA
				line.text = re.sub(line.text, "concerteza","com certeza")
				line.text = re.sub(line.text, "Concerteza","Com certeza")
				--Porfavor para Por favor - FUNCIONA
				line.text = re.sub(line.text, "porfavor","por favor")
				line.text = re.sub(line.text, "Porfavor","Por favor")

				--trás para traz - FUNCIONA
				line.text = re.sub(line.text, "\\b([tT])rás lá","$1raz lá")
				line.text = re.sub(line.text, "(\\b|\\B)([eE])l([ea])(\\so\\s|\\sa\\s|\\s)?trás(\\b)","$1$2l$3$4traz$5")
				line.text = re.sub(line.text, "\\b([Tt])rás([mnl])","$1rás-$2")
				line.text = re.sub(line.text, "\\b([nN])(ão|unca) trás(\\b)","$1$2 traz$3")
				--traz para trás - FUNCIONA
				line.text = re.sub(line.text, "\\b([pP])or traz([ .,?!])","$1or trás$2")
				line.text = re.sub(line.text, "\\b([pP])ara traz([ .,?!])","$1ara trás$2")
				line.text = re.sub(line.text, "\\b([dD])e traz([ .,?!])","$1e trás$2")
				line.text = re.sub(line.text, "\\b([aA])traz([ .,?!])","$1trás$2")
				line.text = re.sub(line.text, "\\b([dD])e( ?)traz([ .,?!])","$1e$2trás$3")

				--policia para polícia - FUNCIONA
				line.text = re.sub(line.text, " ([aAoO]) policia\\b"," $1 polícia$2")
				line.text = re.sub(line.text, "\\b([uU])m policia\\b","$1m polícia$2")
				line.text = re.sub(line.text, "\\b([uU])ma policia\\b","$1ma polícia$2")
				line.text = re.sub(line.text, "\\b([dD])e policia\\b","$1e polícia$2")
				line.text = re.sub(line.text, "\\b([qQ])uem polícia\\b","$1uem policia")
				line.text = re.sub(line.text, "\\b([eE])l([ea]) polícia\\b","$1l$2 policia")

				--a muito tempo por há muito tempo - FUNCIONA
				line.text = re.sub(line.text, "(\\b)[aàá] (muit[oa]s?|bastantes?|alguma?|alguns|algumas|pouc[ao]s?|um|uns|umas?) (tempos?|anos?|mês|meses|dias?|horas?|minutos?|segundos?)","$1há $2 $3")
				line.text = re.sub(line.text, "(\\b)[AÀÁ] (muit[oa]s?|bastantes?|alguma?|alguns|algumas|pouc[ao]s?|um|uns|umas?) (tempos?|anos?|mês|meses|dias?|horas?|minutos?|segundos?)","$1Há $2 $3")

				--depois de . ou ? ou ! ter maíscula - FUNCIONA
				function maiusPont( first, second, rest)
					return first..second..rest:upper()
				end
				line.text = line.text:gsub("([%w'\"][%.?!])([%s?])(%l)", maiusPont)
				line.text = line.text:gsub("([%w'\"]?!)([%s?])(%l)", maiusPont)

				--corrigir tags inválidas tipo <i>frase<i> - FUNCIONA
				line.text = re.sub(line.text, "^(\\{[^}]*\\\\)(i0)(.*)(\\{[^}]*\\\\)(i0\\})$","$1i1$3$4$5") --{\i0}frase{\i0} -> {\i1}frase{\i0}
				line.text = re.sub(line.text, "^(\\{[^}]*\\\\)(i1)(.*)(\\{[^}]*\\\\)(i1\\})$","$1$2$3$4i0}") --{\i1}frase{\i1} -> {\i1}frase{\i0}
				--{\i1}frase{\i1}palavra{\i0}resto da frase...{\i0} -> {\i1}frase{\i0}palavra{\i1}resto da frase...{\i0}
				line.text = re.sub(line.text, "^(\\{[^}]*\\\\i1)(.*)(\\{[^}]*\\\\)(i1)(.*)(\\{[^}]*\\\\)(i0)(.*\\{[^}]*\\\\i0\\})$","$1$2$3$7$5$6$4$8")
				--{\i0}frase{\i0}palavra{\i1}resto da frase...{\i1} -> {\i0}frase{\i1}palavra{\i0}resto da frase...{\i1}
				line.text = re.sub(line.text, "^(\\{[^}]*\\\\i0)(.*)(\\{[^}]*\\\\)(i0)(.*)(\\{[^}]*\\\\)(i1)(.*\\{[^}]*\\\\i1\\})$","$1$2$3$7$5$6$4$8")
				--{\i1}frase{\i0}\N{\i1}outra frase{\i0} -> {\i1}frase\Noutra frase{\i0}
				line.text = re.sub(line.text, "^(\\{[^}]*\\\\i1.*)(\\{[^}]*\\\\i0\\})(\\\\N)(\\{[^}]*\\\\i1\\})(.*\\{[^}]*\\\\i0\\})$","$1$3$5")

				--corrigir i sozinho entre espaços por I (Inglês) - FUNCIONA
				line.text = re.sub(line.text, "\\bi\\b","I")
				--Onomatopeias - FUNCIONA
				line.text = line.text:gsub("[H][Ee]+[Yy]+([ .,?!])","Ei%1")
				line.text = line.text:gsub("([ ])h[e]+[y]+([ .,?!])","%1ei%2")
				line.text = line.text:gsub("[H]+[Uu]+[Hh]+([ .,?!])","Hum%1")
				line.text = line.text:gsub("[h]+[u]+[h]+([ .,?!])","hum%1")
				line.text = line.text:gsub("[W]+[Oo]+[Ww]+([ .,?!])","Uau%1")
				line.text = line.text:gsub("[w]+[o]+[w]+([ .,?!])","uau%1")
				line.text = line.text:gsub("[H]+[Mm]+([ .,?!])","Hmm%1")
				line.text = line.text:gsub("[h]+[m]+([ .,?!])","hmm%1")
				line.text = line.text:gsub("[O]+[Ww]+([ .,?!])","Au%1")
				line.text = line.text:gsub("([ ])[o]+[w]+([ .,?!])","%1au%2")
				line.text = line.text:gsub("[W]+[Aa]+[Hh]+","Buá")
				line.text = line.text:gsub("[w]+[a]+[h]+","buá")
				--Colocar estilo musica em todas linhas com ? e caso exista \N alinha a 2º linha correctamente.
				local b = string.find(line.text,"♪")
				local bb = string.find(line.text,"♫")
				local c = string.find(line.text,"\\N")
				local d = string.find(line.text,"\\i1")
				local z = string.find(line.text,"\\alpha")
				if b or bb then --se tiver simbolo musical faz
					if c and not z then -- se tiver 2 linhas e ainda n tiver sido aplicado entao
						if d then -- aplica com italico
							line.text = line.text:gsub("^({.-}*)♪ ({.-})(.-)\\N(.-)","%1♪ %2%3\\N{\\alpha&HFF&}♪ {\\r}%1%2%4")
						else -- senao aplica sem italico
							line.text = line.text:gsub("^({.-}*)♪ (.-)\\N(.-)","%1♪ %2%3\\N{\\alpha&HFF&}♪ {\\r}%1%3")
						end
					end
					line.style = "Música"
				end
				-- * por ♪ - FUNCIONA
				line.text = line.text:gsub("([^*]?)*([^*]?)","%1♪%2")
				subs[i] = line
		end --fim do 1º if

--[[
	--Corrigir timing pro roca que ele é chato...
		--PROBLEMA
		--Dialogue: 0,0:32:18.74,0:32:21.96,Default,,0000,0000,0000,,texto antes
		--Dialogue: 0,0:32:21.96,0:32:22.29,Default,,0000,0000,0000,,texto test depois\Ntexto antes
		--Dialogue: 0,0:32:22.29,0:32:24.90,Default,,0000,0000,0000,,texto test depois
		--RESULTADO
		--Dialogue: 0,0:32:18.74,0:32:21.96,Default,,0000,0000,0000,,texto antes
		--Dialogue: 0,0:32:21.96,0:32:24.90,Default,,0000,0000,0000,,texto test depois
	for i=#subs,1,-1 do --#sel = numero total das linhas e vai do fim da legenda pro inicio
		local line = subs[i]
		local del = i
		local dur = 800 -- duracao maxima em ms, que a linha poderá ter
		if line.class == "dialogue" then
		line.duration = line.end_time - line.start_time --cria a duracao... senao tinha de carregar o karaskel.preproc_line -.-
			if line.text ~= "" and line.duration < dur then -- se duracao for menor que 800ms = 0:00:00.80 entao
				if i > 1 and i < #subs then -- se não for a 1º linha nem a última então
					local antes = subs[i-1]		--buscar linha anterior
					local depois = subs[i+1]	--buscar linha posterior
					linha = line.text:gsub("^(.*)$","%1")
					confirmar = linha == depois.text.."\\N"..antes.text	--comparar se a linha actual (line.text) contém ambas as linhas.
					--aegisub.debug.out(2, "Debug: '%s' \n", confirmar)
					--{\be1\blur1}? {\i1}O amor distante vou buscar{\i} ?
					music_antes = antes.text:gsub("^({.-}+)? ({.-})(.-)({.-}) ?$","%3")
					music_depois = depois.text:gsub("^({.-}+)? ({.-})(.-)({.-}) ?$","%3")
					--{\be1\blur1}? {\i1}Está numa estrela para nos guiar\N{\alpha&HFF&}? {\r\i1\be1\blur1}O amor distante vou buscar{\i} ?
					music_actual = line.text:gsub("^({.-}+)? ({.-})(.-)\\N({.-})? ({.-}+)(.-)({.-}) ?$","%3\\N%6")
					musicas = music_actual == music_depois.."\\N"..music_antes --comparar se a linha actual (line.text) contém ambas as linhas.				
					if confirmar or musicas then --se realmente contiver então
						depois.start_time = antes.end_time -- torna os tempos continuos
						subs[i+1] = depois --insere o tempo alterado na legenda
						subs.delete(del) --apaga a linha que mete nojo
					end
				end 
			end
			
		end
	end
]]--
end --end function

--Correr pelas linhas escolhidas
function add_tags(subs,sel,config)
	if config.chosen == "Linhas Seleccionadas" then
		for x, i in ipairs(sel) do
			corrigir(subs,i,config)
		end
	elseif config.chosen == "Todas as Linhas" then
		for i=1, #subs do
				corrigir(subs,i,config)
		end
	else
		for i=1, #subs do
			if subs[i].style == config.chosen:sub(9) then
				corrigir(subs,i,config)
			end
		end
	end
end

--Inicialização + GUI
function load_macro_add(subs,sel)
	local config
		ok, config = aegisub.dialog.display(create_confi(subs),{"Adicionar","Cancelar"})
	if ok == "Adicionar" then
		cleantags_subs(subs)
		add_tags(subs,sel,config)
		aegisub.set_undo_point("\""..script_name.."\"")
	end
end

aegisub.register_macro(script_name, script_description, load_macro_add)
aegisub.register_filter(script_name, script_description, 0, load_macro_add)
